create table "Countries"
(
    "Id"        uuid                     not null
        constraint "PK_Countries"
            primary key,
    "Name"      text,
    "Code"      text                     not null,
    "Currency"  text,
    "Extention" text,
    "Timezone"  text,
    "CreatedAt" timestamp with time zone not null,
    "UpdatedAt" timestamp with time zone
);

alter table "Countries"
    owner to cx_user;

create unique index "IX_Countries_Code"
    on "Countries" ("Code");

